import { Component } from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { UnitOfControllerService } from 'src/app/controllers/UnitOfController/unit-of-controller.service';
import { Login } from 'src/app/interfaces/login';

@Component({
  selector: 'app-login',
  templateUrl: './login.component.html',
  styleUrls: ['./login.component.scss']
})
export class LoginComponent {
  formLogin!: FormGroup;
  loginObj: Login = this.controller.loginController.returnLoginEmpty();

  constructor(
    private fb: FormBuilder,
    private controller: UnitOfControllerService,
  ) {
    this.formLogin = this.fb.group({
      user: ['', Validators.required],
      password: ['', Validators.required]
    })
  }

  login() {
    this.loginObj.email = this.formLogin.get('user')?.value;
    this.loginObj.senha = this.formLogin.get('password')?.value;

    this.controller.loginController.Login(this.loginObj).subscribe({
      next: (result) => {
        console.log(result);
      },
      error: (error) => {
        console.log(error);
      }
    })
}
}
<div class="login">
  <div class="loginContainer">
    <div class="imgLogin">
      <img src="../../../assets/logoIff.jpeg" alt="logoIff" class="logoIff">
    </div>
    <div class="loginInputs">
      <p class="title">Entrar</p>
      <form [formGroup]="formLogin" class="formLogin">
        <mat-form-field class="inputLogin">
          <mat-label>E-mail ou matrícula</mat-label>
          <input matInput formControlName="user">
          <mat-error *ngIf="formLogin.controls['user'].hasError('required')">E-mail inválido!</mat-error>
        </mat-form-field>
        <mat-form-field class="inputLogin">
          <mat-label>Senha</mat-label>
          <input matInput formControlName="password">
          <mat-error *ngIf="formLogin.controls['password'].hasError('required')">Senha inválida!</mat-error>
        </mat-form-field>
      </form>
      <div class="recoveryPassword">
        <a href="#">Esqueci minha senha</a>
      </div>
      <div class="btnLogin">
        <button mat-raised-button class="buttonConfirm" (click)="login()">Entrar</button>
      </div>
    </div>
  </div>
</div>
